import Tone from 'tone'

function basePart() {
  return new Tone.Part({
    callback: 'Tone.noOp',
    loop: false,
    loopEnd: '1m',
    loopStart: '0',
    playbackRate: '1',
    probability: '1',
    humanize: false,
    mute: false,
    events: []
  })
}
export { basePart }
